import './App.css';
import * as React from 'react';
import Header from "./pages/include/header.js";
import Footer from "./pages/include/footer.js";
import RightMenu from "./pages/include/right_menu.js";
import CntTest from "./pages/cnttest.js";
import { Route, Switch, useHistory } from 'react-router-dom';




const App = () => {

const history = useHistory();

React.useEffect(() => {
      history.push('/helloWorld'); // 마운트 될 때 /helloWorld에 해당하는 페이지로 이동
  }, [])
  return (
    <>
    <Switch>
    <div className="App">
      <Header />
      <div className="banner-sec">
          <div className="banner-tit">타이틀입니다.</div>
      </div>
      <div className="wrap">
          <body className="app-body">
            <CntTest />
            <RightMenu />
          </body>
      </div>


      <Footer />

    </div>
    </Switch>
    </>
  );
};

export default App;
